import React from 'react';

const CartItem = ({ product }) => {
    return (
        <tbody>
            <tr>
                <th scope="row">{product.title}</th>
                <td>{product.price}$</td>
                <td>
                    <p>{product.description}</p>
                </td>
                <td>
                    <img src={product.imageUrl} width="50px" height="50px" alt="" />
                </td>
            </tr>
        </tbody >);
}

export default CartItem;
